    else if(hminsuranceContract_ds.object(fieldNum(hminsuranceContract, HMEmployerGroupAll)).getValue()== HMEmployerGroupAll::Group)
    {


        sysTableLookup = SysTableLookup::newParameters(tableNum(CustGroup), this);
